This section shows how to use SeaORM to perform operations between the Fruits table and a new suppliers table. Creating relationships between tables can be verbose when doing so using code. Luckily, SeaORM makes this easy. Define a table called suppliers in the fruit_markets database by taking the following steps: Login to mysql database using username and password created in the installation part of this tutorial in the previous section and switch to fruit_markets database. # Execute use fruit_markets; Create a table suppliers that references the primary key fruit_id of table fruits. This will show the type of fruit the supplier supplies to the fruit markets. CREATE TABLE suppliers( supplier_id INT NOT NULL AUTO_INCREMENT, supplier_name VARCHAR(255) NOT NULL, fruit_id INT NOT NULL, PRIMARY KEY (supplier_id), CONSTRAINT fk_fruits FOREIGN KEY (fruit_id) REFERENCES fruits(fruit_id) ON UPDATE CASCADE ON DELETE CASCADE
) ENGINE=INNODB; Use sea-orm-cli to generate the Entity, Model, Relationship and ActiveModel. $ sea-orm-cli generate entity -o src/suppliers_table -t suppliers A new directory suppliers_table is created in the src directory containing serveral files with code generated by sea-orm-cli. Modify the src/suppliers_table/prelude.rs file to export memorable names of the Entity, ActiveModel etc - pub use super::suppliers::Entity as Suppliers; + pub use super::suppliers::{
+ ActiveModel as SuppliersActiveModel, Column as SuppliersColumn, Entity as Suppliers,
+ Model as SuppliersModel, PrimaryKey as SuppliersPrimaryKey, Relation as SuppliersRelation,
+ }; The src/suppliers_table/suppliers.rs contains errors indicating the super::fruits cannot be found in supper. This means the module is not exported properly. Fix this by importing the module: //! SeaORM Entity. Generated by sea-orm-codegen 0.5.0 use sea_orm::entity::prelude::*; #[derive(Clone, Debug, PartialEq, DeriveEntityModel)]
